// ExampleComponent.js
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// import { set } from 'vue/types/umd';

const Navbar = ({setcategory}) => {
    return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid bg-danger">
                    <a className="navbar-brand" href="#"><span className='badge bg-light text-dark fs-4'>NewsGlance</span></a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <div className="nav-link m-2" onClick={()=>setcategory("technology")}>Technology</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link active m-2" aria-current="page" onClick={()=>setcategory("entertainment")}>Entertainment</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link active m-2" aria-current="page" onClick={()=>setcategory("business")}>Business</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link active m-2" aria-current="page" onClick={()=>setcategory("health")}>Health</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link active m-2" aria-current="page" onClick={()=>setcategory("sports")}>Sports</div>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>

    );
};

export default Navbar;
